d2a13e0e6f0c4d0c61eacf4ba33b05d6fae37d96.source:
query launchesPast {
  launchesPast {
    __typename
    mission_name
    launch_date_local
    launch_site {
      __typename
      site_id
      site_name
    }
    rocket {
      __typename
      rocket_name
      rocket_type
    }
    links {
      __typename
      flickr_images
    }
  }
}

